export const mountLanterns: VariantMountFn = (
  container,
  config,
): (() => void) => {
  const colors = config.colors;

  // Default Ramadan palette  each entry maps 1-to-1 with the 12 lantern slots.
  // colors[0..11] override per-lantern color; colors[12] overrides the rope.
  const DEFAULTS = [
    "#c9a84c",
    "#e8c96b",
    "#8b4513",
    "#2d5a27",
    "#4a8a3a",
    "#8b1a1a",
    "#cc4444",
    "#1a3a6b",
    "#3a6ab8",
    "#6b2fa0",
    "#c44d8a",
    "#1a7a6b",
  ];
  const palette: string[] = DEFAULTS.map((d, i) => colors[i] ?? d);
  const ropeColor = colors[12] ?? colors[0] ?? "#c9a84c";

  function buildLanternSVG(svgIndex: number, color: string): string {
    const { viewBox, gContent } = LANTERN_SVG_DATA[svgIndex];
    const coloredG = gContent.replace(/LANTERN_COLOR/g, color);
    return `<svg viewBox="${viewBox}" xmlns="http://www.w3.org/2000/svg" aria-hidden="true">${coloredG}</svg>`;
  }

  // Responsive lantern count
  const count = Math.max(4, Math.min(12, Math.round(window.innerWidth / 120)));

  const row = document.createElement("div");
  row.className = "ro-lantern-row";

  // Connecting rope across the top
  const rope = document.createElement("div");
  rope.style.cssText = `
    position:absolute;top:0;left:0;width:100%;height:3px;
    background:linear-gradient(90deg,transparent 0%,${ropeColor} 10%,${ropeColor} 90%,transparent 100%);
    opacity:0.6;
  `;
  container.appendChild(rope);

  for (let i = 0; i < count; i++) {
    // lanternStyle 1-12  pin to that design (0-indexed); 0  cycle all
    const svgIndex =
      config.lanternStyle > 0
        ? (config.lanternStyle - 1) % LANTERN_SVG_DATA.length
        : i % LANTERN_SVG_DATA.length;
    const color = palette[i % palette.length];
    const duration = (2.5 + ((i * 0.17) % 1.5)).toFixed(1);
    // Negative delay starts each lantern mid-swing so they all appear
    // immediately on load, just at different phases of the animation.
    const phase = -((i * 0.37) % parseFloat(duration));

    const wrap = document.createElement("div");
    wrap.className = "ro-lantern";
    wrap.style.setProperty("--ro-swing-duration", `${duration}s`);
    wrap.style.animationDelay = `${phase.toFixed(2)}s`;

    const stringEl = document.createElement("div");
    stringEl.className = "ro-lantern-string";

    const svgWrap = document.createElement("div");
    svgWrap.innerHTML = buildLanternSVG(svgIndex, color);

    wrap.appendChild(stringEl);
    wrap.appendChild(svgWrap);
    row.appendChild(wrap);
  }

  container.appendChild(row);

  const onResize = () => {
    const newCount = Math.max(
      4,
      Math.min(12, Math.round(window.innerWidth / 120)),
    );
    if (newCount !== count) {
      row.remove();
      rope.remove();
      mountLanterns(container, config);
    }
  };
  window.addEventListener("resize", onResize, { passive: true });

  return () => {
    row.remove();
    rope.remove();
    window.removeEventListener("resize", onResize);
  };
};
